ical":{"lineStyle":"Single","lineWidth":0.75,"shadow":false,"space":0.0,"hasNoneStyle":false,"color":"#A6A6A6FF"},"horizontal":{"lineStyle":"Single","lineWidth":0.75,"shadow":false,"space":0.0,"hasNoneStyle":false,"color":"#A6A6A6FF"},"diagonalDown":{"lineStyle":"None","lineWidth":0.0,"shadow":false,"space":0.0,"hasNoneStyle":false},"diagonalUp":{"lineStyle":"None","lineWidth":0.0,"shadow":false,"space":0.0,"hasNoneStyle":false}},"shading":{"texture":"TextureNone","backgroundColor":"#FFFFFFFF"},"bidi":false}},{"paragraphFormat":{"styleName":"Normal"},"inlines":[]},{"paragraphFormat":{"styleName":"Heading 3"},"inlines":[{"text":"Cat-like features"}]},{"paragraphFormat":{"styleName":"Normal"},"inlines":[{"text":"While the body of a giant panda looks like that of a bear and the dark circles around its eyes resemble those of a red panda or raccoon, its pupils have vertical slits like the eyes of a cat. Because of their unusual eyes, a popular Chinese name for panda is ‘big bear cat’ "},{"text":"or大‍熊‍貓"},{"text":" /"},{"text":"dà"},{"text":" "},{"text":"xióng"},{"text":" "},{"text":"māo"},{"text":", pronounced as dah-"},{"text":"sshyong"},{"text":"-"},{"text":"maow"},{"text":"."}]},{"paragraphFormat":{"styleName":"Heading 3"},"inlines":[{"text":"DNA results"}]},{"paragraphFormat":{"styleName":"Normal"},"inlines":[{"text":"DNA analysis has put one mystery to rest. It has revealed that while the red panda is a distant relation, the giant panda's closest relative is the spectacled bear from South America."}]},{"paragraphFormat":{"styleName":"Heading 2"},"inlines":[{"text":"Mostly Vegetarian Diet"}]},{"paragraphFormat":{"styleName":"Normal"},"inlines":[{"text":"Giant pandas love bamboo! In fact, their diet is 99% bamboo. Along with bamboo, they eat other plants, small rodents, and occasionally fish. The mystery behind their diet is they have the digestive system of a carnivore. "}]},{"paragraphFormat":{"styleName":"Normal"},"inlines":[{"text":"Their ability to digest bamboo is attributed to tiny microbes that live within their digestive system. As they can only digest about 20% of what they eat, the average giant panda consumes around 14 kilograms (30 pounds) of bamboo a day. In comparison, humans eat about 2 kilograms (5 pounds) of food a day. This enormous diet means the giant panda spends more than 12 hours a day eating to stay nourished. "}]},{"paragraphFormat":{"beforeSpacing":7.0,"styleName":"Normal"},"inlines":[{"text":"Quick Fact ","characterFormat":{"bold":true}},{"text":"As the seasons change, the giant panda prefers different species and parts of bamboo."}]},{"paragraphFormat":{"styleName":"Heading 2"},"inlines":[{"text":"Tiny Cubs"}]},{"paragraphFormat":{"styleName":"Normal"},"inlines":[{"text":"An infant giant panda cub is about the size of a croissant, weighs less than a teacup and is about 900 times smaller than its mother. An average adult mother weighs around 91 kilograms (200 pounds) while newborn weighs only 83 to 190 grams (3 to 4 ounces)."}]},{"paragraphFormat":{"styleName":"Heading 1"},"inlines":[{"text":"Other Fun Giant Panda Facts"}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"Researchers have recently discovered that the gene responsible for tasting savory or umami flavors, such as meat, is inactive in giant pandas."}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"For many centuries, giant pandas were thought to be a mythical creature, like a dragon or unicorn."}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"Unlike other bears in the region, giant pandas don’t hibernate. "}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"Giant pandas can stand erect on their hind legs but rarely walk."}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"The "},{"text":"Qinling"},{"text":" panda, another giant panda species with a dark brown and light brown coat, lives only in the mountains of Shaanxi. "}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"Giant pandas have very sensitive hearing and smell, but they have poor eyesight."}]},{"paragraphFormat":{"leftIndent":28.799999237060547,"styleName":"List Paragraph","listFormat":{"listLevelNumber":0,"listId":0}},"inlines":[{"text":"A newborn giant panda is blind and looks like a tiny, pink, hairless mouse."}]}],"headersFooters":{"header":{"blocks":[{"paragraphFormat":{"styleName":"Header"},"inlines":[]}]},"footer":{"blocks":[{"paragraphFormat":{"styleName":"Footer"},"inlines":[]}]},"evenHeader":{"blocks":[{"paragraphFormat":{"styleName":"Header"},"inlines":[]}]},"evenFooter":{"blocks":[{"paragraphFormat":{"styleName":"Footer"},"inlines":[]}]},"firstPageHeader":{"blocks":[{"paragraphFormat":{"styleName":"Header"},"inlines":[]}]},"firstPageFooter":{"blocks":[{"paragraphFormat":{"styleName":"Footer"},"inlines":[]}]}},"sectionFormat":{"headerDistance":36.0,"footerDistance":36.0,"pageWidth":612.0,"pageHeight":792.0,"leftMargin":72.0,"rightMargin":72.0,"topMargin":72.0,"bottomMargin":72.0,"differentFirstPage":false,"differentOddAndEvenPages":false,"bidi":false,"restartPageNumbering":false,"pageStartingNumber":0}}],"characterFormat":{"fontSize":11.0,"fontFamily":"Calibri","fontColor":"#000000FF","fontSizeBidi":11.0,"fontFamilyBidi":"Calibri"},"paragraphFormat":{"afterSpacing":10.0,"lineSpacing":1.149999976158142,"lineSpacingType":"Multiple"},"lists":[{"listId":0,"abstractListId":0}],"abstractLists":[{"abstractListId":0,"levels":[{"listLevelPat