export let weblayout:object = { "sections": [{ "sectionFormat": { "pageWidth": 612, "pageHeight": 792, "leftMargin": 72, "rightMargin": 72, "topMargin": 72, "bottomMargin": 72, "differentFirstPage": false, "differentOddAndEvenPages": false, "headerDistance": 36, "footerDistance": 36 }, "blocks": [{ "paragraphFormat": { "styleName": "Title", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "text": "The Giant Panda" }] }, { "paragraphFormat": { "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "fontFamily": "Calibri" }, "text": "The giant panda, which only " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "lives " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "in China outside of captivity, has captured the hearts of people of all ages across " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "the globe." }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "From their furry black and white bodies to their shy and docile nature, they are considered one of the " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "world's most loved animals." }] }, { "paragraphFormat": { "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "imageString": "data:image/jpeg;base64,", "width": 467.4500099999999, "height": 262.75 }] }, { "paragraphFormat": { "afterSpacing": 0, "lineSpacing": 1, "lineSpacingType": "Multiple", "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "bold": true }, "text": "Quick Fact" }, { "characterFormat": {}, "text": " The estimated number of giant pandas in the wild varies between 1,500 and 3,000." }] }, { "paragraphFormat": { "styleName": "Heading 1", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "text": "Intriguing Giant Panda Mysteries" }] }, { "paragraphFormat": { "afterSpacing": 6, "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "fontFamily": "Calibri" }, "text": "While most adore their fluffy fur and round heads, which help give them their cuddly bear quality, others are " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "fascinated by the many mysteries of the giant panda." }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "Did you know that the giant panda may " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "actually be" }, { "characterFormat": { "fontFamily": "Calibri" }, "text": " a raccoon, " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "they have an opposable pseudo thumb, and that they’re technically a carnivore even though their diet is primarily " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "vegetarian?" }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "These things and more have baffled scientists and naturalists for hundreds of years." }, { "characterFormat": {}, "text": " " }] }, { "paragraphFormat": { "styleName": "Heading 2", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "text": "Opposable Pseudo Thumb" }] }, { "paragraphFormat": { "afterSpacing": 6, "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "fontFamily": "Calibri" }, "text": "A characteristic of the giant panda that has mystified scientists is their movable, elongated wrist bone that acts like " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "an opposable thumb." }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "This human-like quality that helps give them even more of a cuddly-bear appearance enables " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "the giant panda to pick up objects and even eat sitting up" }, { "characterFormat": {}, "text": ". " }] }, { "paragraphFormat": { "afterSpacing": 6, "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "bold": true }, "text": "Quick Fact" }, { "characterFormat": {}, "text": " Giant pandas have five clawed toes and one pseudo thumb." }] }, { "paragraphFormat": { "afterSpacing": 6, "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "bookmarkType": 0, "name": "_GoBack" }, { "characterFormat": {}, "bookmarkType": 1, "name": "_GoBack" }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "Their pseudo thumb, along with pads of skin, help the giant panda strip the more nutritious small bamboo shoots " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "and leaves while holding the stalk in their mouth." }] }, { "paragraphFormat": { "styleName": "Heading 2", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": {}, "text": "Small Bear or Large Raccoon?" }] }, { "paragraphFormat": { "styleName": "Normal", "listFormat": {} }, "characterFormat": {}, "inlines": [{ "characterFormat": { "fontFamily": "Calibri" }, "text": "Giant pandas are generally referred to as bears and are typically called panda bears rather than giant pandas." }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "Though we may think they look like bears, there has been a great deal of discussion for decades about where giant " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "pandas " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "fit" }, { "characterFormat": { "fontFamily": "Calibri" }, "text": " in the animal kingdom." }, { "characterFormat": {}, "text": " " }, { "characterFormat": { "fontFamily": "Calibri" }, "text": "Much of the debate has been whether they are more closely related to the red " }, { "cha