						"afterSpacing": 6.0,
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "Their pseudo thumb, along with pads of skin, help the giant panda strip the more nutritious small bamboo shoots and leaves while holding the stalk in their mouth."
