				},
				{
					"paragraphFormat": {
						"styleName": "Heading 3"
					},
					"inlines": [
						{
							"text": "Cat-like features"
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "While the body of a giant panda looks like that of a bear and the dark circles around its eyes resemble those of a red panda or raccoon, its pupils have vertical slits like the eyes of a cat. Because of their unusual eyes, a popular Chinese name for panda "
						},
						{
							"text": "is ‘big bear cat’ "
						},
						{
							"text": "or"
						},
						{
							"text": "大"
						},
						{
							"text": "‍"
						},
						{
							"text": "熊"
						},
						{
							"text": "‍"
						},
						{
							"text": "貓"
						},
						{
							"text": " /"
						},
						{
							"text": "dà"
						},
						{
							"text": " "
						},
						{
							"text": "xióng"
						},
						{
							"text": " "
						},
						{
							"text": "māo"
						},
						{
							"text": ", pronounced as dah-"
						},
						{
							"text": "sshyong"
						},
						{
							"text": "-"
						},
						{
							"text": "maow"
						},
						{
							"text": "."
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Heading 3"
					},
					"inlines": [
						{
							"text": "DNA results"
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "DNA analysis has put one mystery to rest. It has revealed that while the red panda is a distant relation, the giant panda's closest relative is the spectacled bear from So"
						},
						{
							"text": "uth America."
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Heading 2"
					},
					"inlines": [
						{
							"text": "Mostly Vegetarian Diet"
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "Giant pandas love bamboo! In fact, their diet is 99% bamboo. Along with bamboo, they eat other plants, small rodents, and occasionally fish. The mystery behind their diet is they have the digestive system of a carnivore."
						},
						{
							"text": " "
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "Their ability to digest bamboo is attributed to tiny microbes that live within their digestive system. As they can only digest about 20% of what they eat, the average giant panda consumes around 14 kilograms (30 pounds) of bamboo a day. In comparison, hu"
						},
						{
							"text": "mans eat about 2 kilograms (5 pounds) of food a day. This enormous diet means the giant panda spends more than 12 hours a day eating to stay nourished. "
						}
					]
				},
				{
					"paragraphFormat": {
						"beforeSpacing": 7.0,
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "Quick Fact ",
							"characterFormat": {
								"bold": true
							}
						},
						{
							"text": "As the seasons change, the giant panda prefers different species and parts of bamboo."
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Heading 2"
					},
					"inlines": [
						{
							"text": "Tiny Cubs"
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Normal"
					},
					"inlines": [
						{
							"text": "An infant giant panda cub is about the size of a croissant, weighs less than a teacup and is about 900 times smaller "
						},
						{
							"text": "than its mother. An average adult mother weighs around 91 kilograms (200 pounds) while newborn weighs only 83 to 190 grams (3 to 4 ounces)."
						}
					]
				},
				{
					"paragraphFormat": {
						"styleName": "Heading 1"
					},
					"inlines": [
						{
							"text": "Other Fun Giant Panda Facts"
						}
					]
				},
				{
					"paragraphFormat": {
						"leftIndent": 28.799999237060548,
						"styleName": "List Paragraph",
						"listFormat": {
							"listLevelNumber": 0,
							"listId": 0
						}
					},
					"inlines": [
						{
							"text": "Researchers have recently discovered that the gene responsible for tasting savory or uma"
						},
						{
							"text": "mi flavors, such as meat, is inactive in giant pandas."
						}
					]
				},
				{
					"paragraphFormat": {
						"leftIndent": 28.799999237060548,
