						"listFormat": {
							"listLevelNumber": 0,
							"listId": 0
						}
					},
					"inlines": [
						{
							"text": "Unlike other bears in the region, giant pandas don’t hibernate. "
						}
					]
				},
				{
					"paragraphFormat": {
						"leftIndent": 28.799999237060548,
						"styleName": "List Paragraph",
